import './App.css';
import ReactApexChart from 'react-apexcharts'
import { useState } from 'react';

function App() {

  const [type, settype] = useState('line')

  let series= [{
    name: 'Net Profit',
    data: [44, 55, 57, 56, 61, 58, 63, 60, 66]
  }]

  let options= {
    chart: {
      type: {type},
      height: 350
    },

    dataLabels: {
      enabled: false
    },
    stroke: {
      curve: 'straight',
      show: true,
      width: 2,
      colors: ['transparent']
    },
    xaxis: {
      categories: ['Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct'],
    },
    yaxis: {
      title: {
        text: '$ (thousands)'
      }
    },
    fill: {
      opacity: 1
    },
    tooltip: {
      y: {
        formatter: function (val) {
          return "$ " + val + " thousands"
        }
      }
    }
  }



  return (
    <div className="App">
        <div className="app_body">
          <div className="buttons">
            <div className="bar">
                <button>Bar</button>
            </div>
            <div className="pie">
                <button>Pie</button>
            </div>
            <div className="donut">
                <button>Donut</button>
            </div>
            <div className="line">
                <button>Line</button>
            </div>
            <div className="dots">
                <button>Dots</button>
            </div>
          </div>
          <div className="chart">
            <ReactApexChart options={options} series={series} type={type} height={450} />
          </div>
        </div>
    </div>
  );
}

export default App;
